import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom'; // Updated import
import Navbar from './components/Navbar'; // Import the Navbar component
import Home from './pages/Home'; // Import the Home page component
import BookingPage from './pages/BookingPage'; // Import the BookingPage component
import Terms from './pages/Terms'; // Import the Terms page component
import './styles/App.css'; // Import the global styles

const App = () => {
  return (
    <Router>
      <div>
        {/* Navbar displayed on all pages */}
        <Navbar />

        <Routes> {/* Updated from Switch to Routes */}
          {/* Home page route */}
          <Route path="/" element={<Home />} /> {/* Updated from component to element */}

          {/* Booking page route */}
          <Route path="/booking" element={<BookingPage />} /> {/* Updated from component to element */}

          {/* Terms page route */}
          <Route path="/terms" element={<Terms />} /> {/* Updated from component to element */}
        </Routes>
      </div>
    </Router>
  );
};

export default App;
